Array.intersect = function () {
  var result = new Array();
  var obj = {};
  for (var i = 0; i < arguments.length; i++) {
    for (var j = 0; j < arguments[i].length; j++) {
      var str = arguments[i][j];
      if (!obj[str]) {
        obj[str] = 1;
      } else {
        obj[str]++;
        if (obj[str] == arguments.length) {
          result.push(str);
        }
      } //end else
    } //end for j
  } //end for i
  return result;
};

/**
 * æ ¹æ®æ•°ç»„é›†åˆï¼Œä¸¤ä¸¤ç›¸æ¯”å–äº¤é›†åå†å–åˆé›†
 * @param {é›†åˆ} val
 */
function getConflict(val) {
  let result = new Set();
  for (let item1 of val.keys()) {
    for (let item2 of val.keys()) {
      if (item1 !== item2) {
        if (Array.intersect(item1, item2).length !== 0) {
          // console.log(chalk.yellow(item1, item2), `=>`, ...Array.intersect(item1, item2));
          Array.intersect(item1, item2).forEach(element => {
            result.add(element);
          });
        }
      }
    }
  }
  return result;
}

